function es_get_formatted_leasing_sf( $post_id = null ) {
	if ( ! $post_id ) {
		$post_id = get_the_ID();
	}
	$property = es_get_property( $post_id );

	// Use existing fields from Fields Builder
	$min = $property->min_sq_ft_lease;
	$max = $property->max_sq_ft_lease;

	if ( empty( $min ) && empty( $max ) ) {
		return null;
	}

	// Only max set: "Up to X,XXX SF"
	if ( empty( $min ) && ! empty( $max ) ) {
		return sprintf( __( 'Up to %s SF', 'es-plugin' ), number_format_i18n( $max ) );
	}

	// Only min set: "X,XXX+ SF"
	if ( ! empty( $min ) && empty( $max ) ) {
		return sprintf( __( '%s+ SF', 'es-plugin' ), number_format_i18n( $min ) );
	}

	// Both set: "X,XXX - X,XXX SF"
	return sprintf( __( '%s - %s SF', 'es-plugin' ), number_format_i18n( $min ), number_format_i18n( $max ) );
}

