/**
 * Overlap-matching query for leasing SF range filter.
 * Property range [p_min, p_max] overlaps search range [s_min, s_max] when:
 * - p_max >= s_min (property doesn't end before search starts)
 * - p_min <= s_max (property doesn't start after search ends)
 */
add_filter( 'es_search_query_meta_query', 'es_leasing_sf_overlap_query', 10, 2 );
function es_leasing_sf_overlap_query( $meta_query, $data ) {
	if ( empty( $data['leasing_sf'] ) ) {
		return $meta_query;
	}

	$s_min = isset( $data['leasing_sf']['min'] ) && $data['leasing_sf']['min'] !== '' ? floatval( $data['leasing_sf']['min'] ) : null;
	$s_max = isset( $data['leasing_sf']['max'] ) && $data['leasing_sf']['max'] !== '' ? floatval( $data['leasing_sf']['max'] ) : null;

	if ( $s_min === null && $s_max === null ) {
		return $meta_query;
	}

	$property = es_get_property( null );
	$prefix   = $property->get_entity_prefix();
	$range    = array( 'relation' => 'AND' );

	// If search has min: property max must be >= search min
	// OR if property has no max (extends to infinity), it always satisfies s_min - just verify it has SF data
	// Using existing field names from Fields Builder: min_sq_ft_lease, max_sq_ft_lease
	if ( $s_min !== null ) {
		$range[] = array(
			'relation' => 'OR',
			array(
				'key'     => "{$prefix}max_sq_ft_lease",
				'value'   => $s_min,
				'compare' => '>=',
				'type'    => 'NUMERIC',
			),
			// Min-only properties (e.g., "10,000+ SF") extend to infinity, always satisfying s_min
			array(
				'relation' => 'AND',
				array( 'key' => "{$prefix}max_sq_ft_lease", 'compare' => 'NOT EXISTS' ),
				array( 'key' => "{$prefix}min_sq_ft_lease", 'compare' => 'EXISTS' ),
			),
		);
	}

	// If search has max: property min must be <= search max
	// OR if property has no min (starts at 0), verify it has max to confirm SF data exists
	if ( $s_max !== null ) {
		$range[] = array(
			'relation' => 'OR',
			array(
				'key'     => "{$prefix}min_sq_ft_lease",
				'value'   => $s_max,
				'compare' => '<=',
				'type'    => 'NUMERIC',
			),
			// Max-only properties (e.g., "Up to 50,000 SF") start at 0, always satisfying s_max
			array(
				'relation' => 'AND',
				array( 'key' => "{$prefix}min_sq_ft_lease", 'compare' => 'NOT EXISTS' ),
				array( 'key' => "{$prefix}max_sq_ft_lease", 'compare' => 'EXISTS' ),
			),
		);
	}

	$meta_query[] = $range;
	return $meta_query;
}

